import { Route, Router } from 'react-router';
import './App.css';
import Login from './components/Auth/login/login';
import Signup from './components/Auth/signup/signup';

function App() {
  return (
    <Router>
    <div className="App">
      <switch>
        <Route path="/" exact component={Login} />
        <Route path="/signup" component={Signup} />
      </switch>
    </div>
  </Router>


  );
}

export default App;
